import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter as Router } from 'react-router-dom';
import HomeScreen from './screens/HomeScreen'; // Õige impordi tee

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <App />
      <HomeScreen /> {/* Veenduge, et siin oleks õige komponendi nimi */}
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
